//配置路由
import { Routes, Route, Navigate } from "react-router-dom";


import Top from '../components/FootPlay'
import Content from '../components/FindMusic/Content'
import Foot from '../components/FootPlay'
import FootPlay from '../components/FootPlay'
import Banner from '../components/FindMusic/Banner'


export default [
  {
    path: '/',
    element: <Content />
  },
  {
    path: '/Foot',
    element: <Foot />
  },
  {
    path: "/",
    // 路由重定向, 借助Navigate组件跳转
    element: <Navigate to="/home" replace />
  }
]
